import React, { useContext } from "react";
import Post from "../Post/Post";
import "./posts.css";
import { StoreContext } from "../../store";

function Posts() {
  const state = useContext(StoreContext);
  console.log(state);
  return (
    <div className="posts">
      {state.posts.map((item) => (
        <Post id={item.id} />
      ))}
    </div>
  );
}
export default Posts;
